import { Container, Row } from "./LandingHeroElements";

function LandingHero() {
  return (
    <Container>
      <Row>
        <h2>Good Day</h2>
        <h3>Patrick Kahuhia</h3>
      </Row>
      <Section></Section>
    </Container>
  );
}

export default LandingHero;
